import './App.css';
import { Fragment } from 'react';
import Navbar from "./Components/Navbar"
import FooterCompoment from "./Components/FooterCompoment"
import SingIn from './Components/SingIn';
import Dashboard from './Components/Dashboard';

function App() {
  return (
    <Fragment>
      <Navbar/>
      <SingIn />
      <FooterCompoment />
      <Dashboard />
    </Fragment>
  );
}

export default App;
